import React from 'react';

const PortfolioTopBar = () => {
	return (
		<>
			<div className="portfolio-top-bar">
				<p>Portfolio</p>
				<ul>
					<li>Aplikacje mobilne</li>
					<li>Strony internetowe</li>
				</ul>
			</div>
		</>
	);
};

export default PortfolioTopBar;
